import React from 'react';
import classes from './StepTen.module.css';
import AddNewTag from './AddNewTag';

import Tag from '../../UI/Tag.js';
const TagsManager = ({
	onTitleChange,
	tagTitle,
	tags,
	onNewTag,
	onSelectToggle,
	tagCateogory,
}) => {
	const categoryAdder = (item) => {
		item['tagCategory'] = tagCateogory;
		props.onNewTag(item);
	};
	return (
		<>
			<AddNewTag
				onNewTag={categoryAdder}
				onTitle={onTitleChange}
				tagTitle={tagTitle}
			/>

			<br />

			<div className={classes.selectedTextArea}>
				{/* {state.dataIsLoading && <Loading />} */}

				{tags.length > 0 ? (
					tags.map((obj, i) => (
						<Tag
							key={obj.id}
							title={obj.title}
							id={obj.id}
							status={obj.status}
							onClick={onSelectToggle}
						/>
					))
				) : (
					<div></div>
				)}
			</div>
		</>
	);
};

export default TagsManager;
